import Nav from "./Nav";
const Principal = () => {
    return ( 
    <div>
        <Nav/>
        
        <div className={s.container}>
        <div className={s.grid}>
            {currentCountry.map(c=>(
            <Link key={c.id} className={s.link} to={"/" + c.id}>
                <Card 
                name={ c.name}
                flag={ c.flag}
                continent={ c.continent} 
                />
            </Link>
        )
        )}
        </div>
        </div> 
    </div> 
    );
}
 
export default Principal;
